B.atM=new A.N("    Chia s\u1ebb thu\u1eadn l\u1ee3i: V\u1edbi t\xednh n\u0103ng m\xe3 QR, b\u1ea1n c\xf3 th\u1ec3 chia s\u1ebb th\xf4ng tin li\xean h\u1ec7 c\u1ee7a m\xecnh m\u1ed9t c\xe1ch d\u1ec5 d\xe0ng h\u01a1n bao gi\u1edd h\u1ebft. Kh\xf4ng c\u1ea7n ph\u1ea3i nh\u1eadp tay th\xf4ng tin ho\u1eb7c g\u1eedi tin nh\u1eafn v\u0103n b\u1ea3n, ch\u1ec9 c\u1ea7n qu\xe9t m\xe3 QR v\xe0 m\u1ecdi th\xf4ng tin s\u1ebd t\u1ef1 \u0111\u1ed9ng \u0111\u01b0\u1ee3c \u0111\u01b0a v\xe0o danh b\u1ea1 c\u1ee7a ng\u01b0\u1eddi nh\u1eadn.",null,null,null,null,null,null,null,null,null,null)
